d3.tools={keys:function(e){var t=[];for(var n in e)t.push(n);return t},extend:function(e,t){var n={};for(var r in e)n[r]=e[r];for(var r in t)n[r]=t[r];return n},addClass:function(e,t){var n=e.attr("class");n===null?n=t:n.indexOf(t)==-1&&(n+=" "+t);e.attr("class",n)},removeClass:function(e,t){var n=e.attr("class");if(n===null)n="";else if(n.indexOf(t)>-1){n=n.replace(t,"");n=n.replace("  "," ")}e.attr("class",n)},toggleClass:function(e,t){var n=e.attr("class");if(n===null)n=t;else if(n.indexOf(t)>-1){n=n.replace(t,"");n=n.replace("  "," ")}else n+=" "+t;e.attr("class",n)},clone:function(e){return JSON.parse(JSON.stringify(e))},polarToCartesian:function(e,t){var n=[0,0];n[0]=t*Math.cos(e);n[1]=t*Math.sin(e);return n},cartesianToPolar:function(e,t){var n=[0,0];n[0]=Math.atan2(t,e);n[1]=Math.sqrt(e*e+t*t);return n}};